import React,{useState} from "react";
import axios from 'axios';

const useFormInput=intialvalue=>{
    const [value, setValue] = useState(intialvalue)

    const handleChange=(e)=>{
        setValue(e.target.value);
    }
     return(
         {         value,
         onChange: handleChange }

     )
             

    }

const Login =(props)=>{

    const [Loading, setLoading] = useState(false)
    const username = useFormInput('');
    const password = useFormInput('');
    const [error, setError] = useState(null);

    
   const handlesubmit=()=>{
    setError(null);
    setLoading(true);
    
        axios.post('http://localhost:8080/hospitalApp/welcome/login', { 
           
            userName: username.value,
             password: password.value 
            }) .then(response => {
                setLoading(false);
          console.log("res",response.data.userName);
          if(response.data.message==="SUCCESS")
          props.history.push('/Home');
          else
         setError("Something went wrong. Please try again later.");
        }).catch(error => {
          setLoading(false);
         setError("Something went wrong. Please try again later.");
        });
      }
        console.log('click')
    
    return(

        <div className="container  mx-4 py-4">
            <input type="username" className="mx-2 my-2"{...username}  /><br/>
            <input type="password"className="mx-2 my-2" {...password}/><br/>
            {error &&<p>error</p>}
            <button onClick={handlesubmit} type="button"className="mx-5 btn btn-primary">login</button>
        </div>
        
    )
}

export default Login;
